import React from 'react';

export const Jumbotron = () => (
    <div className="jumbotron jumbotron-fluid bg-warning">
      <div className="container text-sm-center pt-5 pb-0 text-white">
        <h1 className="display-2">3D Asset Store</h1>
        <p className="lead">Amazing 3D Art for your XR Experiences</p>
      </div>
    </div>
);
